Carvajal no se entera de la película
y a Busquets se le estàn viendo las costuras no aguanta el ritmo y tiene amarilla , me gustaria ver a Ansu Fati y a Carlos Soler , veremos la segunda parte.

@jorgeruve Si España fuera el @valenciacf habría perdido porque habrían pitado penalti en la mano de Busquets.
No puede ser que Rodrigo Moreno y Jose Luis Gayà estén en casa y Nico Williams y el Balde estén jugando en Qatar.
